$(".A4WJF").on("click",function(event){event.preventDefault();if($(this).find(".fa-plus-square").hasClass("d-none")){$(this).find(".fa-plus-square").removeClass("d-none");$(this).find(".fa-minus-square").addClass("d-none");$(this).parent().next().slideUp("fast")}else{$(this).find(".fa-minus-square").removeClass("d-none");$(this).find(".fa-plus-square").addClass("d-none");$(this).parent().next().slideDown("fast")}});